  return (
    <div>
      <Navbar />
      <div className="landing-container">
        <div className="image-container">
        <img src={`${process.env.PUBLIC_URL}/assets/landingtemple1.jpeg`} alt="Logo" />
        </div>

        <div className="image-container">
